import React, { Component } from 'react'
// import { Button } from '@material-ui/core'
import SysPopup from './assets/components/CommonComponents/BasicComponents/SysPopup/SysPopup'
// import HeaderPopup from './assets/components/PopupComponents/Header/HeaderPopup'
import Button from './assets/components/CommonComponents/Layout/Button'
import Help from './assets/components/PopupComponents/Help/Help'
class App extends Component {
    constructor(props) {
        super(props)
        this.state = {
            isOpenPopup: true,
        }
    }
    render() {
        return (
            <div>
                <Button
                    type="primary"
                    disabled={false}
                    title="Help"
                    onClick={() => {
                        this.setState({ ...this.state, isOpenPopup: true })
                    }}
                >
                    Help
                </Button>
                <SysPopup
                    Open={this.state.isOpenPopup}
                    Title={'Help'}
                    onClose={() => {
                        this.setState({ ...this.state, isOpenPopup: false })
                    }}
                    LayoutWidth={'50%'}
                >
                    <Help />
                </SysPopup>
            </div>
        )
    }
}

export default App
